import React from 'react';


class App extends React.Component {

   state = {
       list:[],
   } 


   componentDidMount(){
           //API request from country rest full apis
    fetch(`https://restcountries.eu/rest/v2/all`)
       .then(res => res.json())
       .then(json => {
           this.setState ({
               list:json,
           })


       })
   }







    render () {
        return (

            <div className="App">

         {console.log(this.state.list[0].name)}


            </div>
        )
    }

}

export default App;
